    [],nt"revision_timestamp": "2015-09-26T20:24:32.087467",nt"name": "nodc-standard-format-intertidal-subtidal-f100-data-1974-1979-nodc-accession-0014193",nt"isopen":
    false,nt"url": null,nt"notes": "This data type is used to support physical
    and biological studies of the intertidal/subtidal regime. There are eight data record
    types to: 1) identify the station, 2) report on the sediment analysis, 3) describe
    the biological sample, 4) identify species, 5) examination of an individual fish,
    6) analyze the stomach contents of the individual fish examined, and 7) a text record,
    8) a sample record. Each record is 80 characters in length, sorted by station and
    sequence numbers for proper order. The first nine columns for all records are to
    be used for file type (columns 1-3) and file identifier (columns 4-9). The file
    identifier, to be assigned by the originator, is a unique originator id for each
    data submission. After submission, the NODC reassigns to this field a unique NODC
    identifier for internal use.",nt"license_title": null,nt"extras": [{ntt"key":
